  \"topographic-lidar-survey-of-the-chandeleur-islands-louisiana-february-6-2012-classified-point-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Data Series Report contains lidar
  elevation data collected February 6, 2012, over the Chandeleur Islands, Louisiana.
  LAS 1.2 formatted point data files were generated based on these data. The point
  cloud data were processed to extract bare earth data; therefore, the point cloud
  data are classified into only these classes: 1 and 17-unclassified, 2-ground, 9-water,
  and 10-breakline proximity. Digital Aerial Solutions, LLC, was contracted by the
  USGS to collect and process these data. The lidar data were collected at a nominal
  pulse spacing (NPS) of 0.5 meter (m). The data are in decimal degree geographic
  coordinates, North American Datum 1983, National Spatial Reference System 2007 (NAD83
  NSRS2007)). The vertical datum is North American Vertical Datum 1988, Geoid 2009,
  Geodetic Reference System 1980 (NAVD88 GEOID09 GRS80) in meters. Thirty-three LAS
  files, based on a 2-kilometer by 2-kilometer tiling scheme, cover the entire survey
  area. These lidar data are available to Federal, State and local governments, emergency-response
  officials, resource managers, and the general public.\",\n\t\"license_title\": null,\n\t\"extras\":
